    <h4>2</h4>
  </div>
  <div className="item">
    <h4>3</h4>
  </div>
  <div className="item">
    <h4>4</h4>
  </div>
  <div className="item">
    <h4>5</h4>
  </div>
  <div className="item">
    <h4>6</h4>
  </div>
  <div className="item">
    <h4>7</h4>
  </div>
  <div className="item">
    <h4>8</h4>
  </div>
</div>

    ))}
   
    </OwlCarousel>
    </div>
    
  )
}
